// --- تضمين الصورة كـ Base64 (لحل مشاكل التحميل والتصدير نهائياً) ---
const bgBase64 = "data:image/png;base64,";

// تهيئة المتغيرات العامة
let currentTemplate = 1;
const canvas = document.getElementById('previewCanvas');
const ctx = canvas.getContext('2d', { alpha: false });
const logoImg = document.getElementById('logoImg'); 
const bgImg = new Image();

// إعدادات الصورة
bgImg.crossOrigin = "Anonymous"; 
bgImg.src = bgBase64;

// تحميل الخطوط والصور قبل الرسم
Promise.all([
    document.fonts.ready,
    new Promise(resolve => {
        if (bgImg.complete) resolve();
        else bgImg.onload = resolve;
    })
]).then(() => {
    updateCanvas();
});

// --- منطق السلايدر (Slider Logic) ---
let currentSlide = 0;
const slides = document.querySelectorAll('.slide');
const dots = document.querySelectorAll('.slider-dot');
let slideInterval;

function initSlider() {
    startSlideTimer();
    const sliderContainer = document.getElementById('slider-track').parentElement;
    if(sliderContainer) {
        sliderContainer.addEventListener('mouseenter', stopSlideTimer);
        sliderContainer.addEventListener('mouseleave', startSlideTimer);
    }
}

function showSlide(index) {
    if (index >= slides.length) currentSlide = 0;
    else if (index < 0) currentSlide = slides.length - 1;
    else currentSlide = index;

    slides.forEach((slide, i) => {
        if (i === currentSlide) {
            slide.classList.remove('opacity-0');
            slide.classList.add('opacity-100', 'z-10');
        } else {
            slide.classList.remove('opacity-100', 'z-10');
            slide.classList.add('opacity-0');
        }
    });

    dots.forEach((dot, i) => {
        if (i === currentSlide) {
            dot.classList.remove('opacity-50');
            dot.classList.add('opacity-100', 'w-6');
        } else {
            dot.classList.remove('opacity-100', 'w-6');
            dot.classList.add('opacity-50');
        }
    });
}

function nextSlide() { showSlide(currentSlide + 1); }
function prevSlide() { showSlide(currentSlide - 1); }
function goToSlide(index) { showSlide(index); }
function startSlideTimer() { stopSlideTimer(); slideInterval = setInterval(nextSlide, 5000); }
function stopSlideTimer() { if (slideInterval) clearInterval(slideInterval); }

if (document.querySelectorAll('.slide').length > 0) initSlider();


// --- منطق الرسم (Canvas Logic) ---

function selectTemplate(id) {
    currentTemplate = id;
    document.querySelectorAll('.template-card').forEach(card => {
        card.classList.remove('active');
        card.querySelector('.check-icon').style.opacity = '0';
    });
    const selectedCard = document.querySelectorAll('.template-card')[id-1];
    if(selectedCard) {
        selectedCard.classList.add('active');
        selectedCard.querySelector('.check-icon').style.opacity = '1';
    }
    updateCanvas();
}

function updateCanvas() {
    // التأكد من تحميل صورة الخلفية قبل الرسم
    if (!bgImg.complete) return;

    // --- تحسين دقة الرسم ---
    ctx.imageSmoothingEnabled = true;
    ctx.imageSmoothingQuality = 'high';
    // ----------------------

    ctx.clearRect(0, 0, canvas.width, canvas.height);
    
    const data = {
        shopName: document.getElementById('shopName').value || 'شبكة المياس',
        phone: document.getElementById('phoneNumber').value || '773 338 337',
        extraText: document.getElementById('extraText').value || 'خدمات الدفع الإلكتروني'
    };

    // رسم الخلفية
    try {
        ctx.drawImage(bgImg, 0, 0, canvas.width, canvas.height);
    } catch (e) {
        console.error("خطأ في رسم الخلفية:", e);
    }

    // رسم النصوص
    drawTexts(currentTemplate, data);
}

function drawTexts(id, data) {
    const w = canvas.width;
    const h = canvas.height;

    ctx.textAlign = 'center';
    ctx.textBaseline = 'middle';

    // 1. اسم المحل (عنابي داخل المربع الأبيض)
    ctx.fillStyle = '#831843'; // لون عنابي
    ctx.font = 'bold 55px "IBM Plex Sans Arabic"';
    ctx.shadowColor = 'rgba(0,0,0,0.1)';
    ctx.shadowBlur = 2;
    ctx.fillText(data.shopName, w / 2, 345);
    ctx.shadowBlur = 0;

    // 2. رقم التواصل (أبيض داخل المربع العنابي)
    ctx.fillStyle = '#ffffff'; // أبيض
    ctx.font = 'bold 55px "IBM Plex Sans Arabic"';
    ctx.fillText(data.phone, w / 2 + 20, 760);

    // 3. النص الإضافي (أصفر تحت المربع العنابي)
    ctx.fillStyle = '#fbbf24'; // أصفر ذهبي
    ctx.font = 'bold 35px "IBM Plex Sans Arabic"';
    ctx.shadowColor = 'rgba(0,0,0,0.0)';
    ctx.shadowBlur = 4;
    ctx.fillText(data.extraText, w / 2, 850); 
    ctx.shadowBlur = 0;
}

// دالة التحميل
function downloadImage() {
    const btn = document.querySelector('button[onclick="downloadImage()"]');
    const originalContent = btn.innerHTML;
    const loadingOverlay = document.getElementById('loadingOverlay');
    
    loadingOverlay.classList.remove('hidden');
    btn.disabled = true;
    btn.innerHTML = '<i class="fa-solid fa-spinner fa-spin ml-2"></i> جاري المعالجة...';

    setTimeout(() => {
        try {
            const link = document.createElement('a');
            link.download = 'almaias-design-' + Date.now() + '.png';
            link.href = canvas.toDataURL('image/png', 1.0);
            document.body.appendChild(link);
            link.click();
            document.body.removeChild(link);
        } catch (error) {
            console.error("Download Error:", error);
            alert("حدث خطأ أثناء التنزيل. يرجى المحاولة مرة أخرى.");
        } finally {
            loadingOverlay.classList.add('hidden');
            btn.disabled = false;
            btn.innerHTML = originalContent;
        }
    }, 500);
}

// إعادة الرسم عند تحميل الصفحة
window.onload = updateCanvas;
